# LeetCode #340 Medium - Longest Substring with At Most K Distinct Characters
class Solution(object):
    def lengthOfLongestSubstringKDistinct(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: int
        """
        n = len(s)
        if k == 0 or n == 0:
            return 0
        if n == 1: return 1

        max_len = 1
        hash = {}
        left = 0
        right = 0
        while right < n:
            hash[s[right]] = right
            right += 1

            if len(hash) == k + 1:
                del_ix = min(hash.values())
                del hash[s[del_ix]]
                left = del_ix + 1

            max_len = max(max_len, right - left)
        return max_len


sln = Solution()
